import jdk.internal.util.xml.impl.Input;import java.util.Scanner;class DictionaryManagement {    public Dictionary _dictionary;    /*    ham them t vao list dictionary     */    public  void insertFromCommandline(){        Scanner scan = new Scanner(System.in);        System.out.println("so luong tu: ");        int n;        n = scan.nextInt();        for(int i=0; i<n; i++) {            System.out.println("English: ");            String word = scan.next();            System.out.println("Vietnamese: ");            String explain = scan.next();            _dictionary.AddNewWord(word, explain);        }        System.out.println("Hello");    }}